import React, { useState } from 'react';
import { supabase } from '../supabase';

const AuthTest = () => {
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [otp, setOtp] = useState('');
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);

  const testEmailOTP = async () => {
    setLoading(true);
    setMessage('');
    
    try {
      console.log('Testing email OTP with:', email);
      const { data, error } = await supabase.auth.signInWithOtp({
        email: email,
      });
      
      if (error) {
        console.error('Email OTP error:', error);
        setMessage(`Error: ${error.message}`);
      } else {
        console.log('Email OTP success:', data);
        setMessage('OTP sent successfully! Check your email.');
      }
    } catch (error) {
      console.error('Email OTP exception:', error);
      setMessage(`Exception: ${error.message}`);
    }
    
    setLoading(false);
  };

  const testPhoneOTP = async () => {
    setLoading(true);
    setMessage('');
    
    try {
      console.log('Testing phone OTP with:', phone);
      const { data, error } = await supabase.auth.signInWithOtp({
        phone: phone,
      });
      
      if (error) {
        console.error('Phone OTP error:', error);
        setMessage(`Error: ${error.message}`);
      } else {
        console.log('Phone OTP success:', data);
        setMessage('OTP sent successfully! Check your phone.');
      }
    } catch (error) {
      console.error('Phone OTP exception:', error);
      setMessage(`Exception: ${error.message}`);
    }
    
    setLoading(false);
  };

  const verifyEmailOTP = async () => {
    setLoading(true);
    setMessage('');
    
    try {
      console.log('Verifying email OTP:', { email, otp });
      const { data, error } = await supabase.auth.verifyOtp({
        email: email,
        token: otp,
        type: 'email'
      });
      
      if (error) {
        console.error('Email OTP verification error:', error);
        setMessage(`Error: ${error.message}`);
      } else {
        console.log('Email OTP verification success:', data);
        setMessage('Email OTP verified successfully!');
      }
    } catch (error) {
      console.error('Email OTP verification exception:', error);
      setMessage(`Exception: ${error.message}`);
    }
    
    setLoading(false);
  };

  const verifyPhoneOTP = async () => {
    setLoading(true);
    setMessage('');
    
    try {
      console.log('Verifying phone OTP:', { phone, otp });
      const { data, error } = await supabase.auth.verifyOtp({
        phone: phone,
        token: otp,
        type: 'sms'
      });
      
      if (error) {
        console.error('Phone OTP verification error:', error);
        setMessage(`Error: ${error.message}`);
      } else {
        console.log('Phone OTP verification success:', data);
        setMessage('Phone OTP verified successfully!');
      }
    } catch (error) {
      console.error('Phone OTP verification exception:', error);
      setMessage(`Exception: ${error.message}`);
    }
    
    setLoading(false);
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-bold mb-4">Auth Test</h2>
      
      <div className="space-y-4">
        <div>
          <label className="block text-sm font-medium mb-1">Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-2 border rounded"
            placeholder="test@example.com"
          />
          <button
            onClick={testEmailOTP}
            disabled={loading || !email}
            className="mt-2 px-4 py-2 bg-blue-500 text-white rounded disabled:opacity-50"
          >
            Send Email OTP
          </button>
        </div>

        <div>
          <label className="block text-sm font-medium mb-1">Phone:</label>
          <input
            type="tel"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="w-full p-2 border rounded"
            placeholder="+1234567890"
          />
          <button
            onClick={testPhoneOTP}
            disabled={loading || !phone}
            className="mt-2 px-4 py-2 bg-green-500 text-white rounded disabled:opacity-50"
          >
            Send Phone OTP
          </button>
        </div>

        <div>
          <label className="block text-sm font-medium mb-1">OTP:</label>
          <input
            type="text"
            value={otp}
            onChange={(e) => setOtp(e.target.value)}
            className="w-full p-2 border rounded"
            placeholder="123456"
            maxLength="6"
          />
          <div className="mt-2 space-x-2">
            <button
              onClick={verifyEmailOTP}
              disabled={loading || !email || !otp}
              className="px-4 py-2 bg-blue-500 text-white rounded disabled:opacity-50"
            >
              Verify Email OTP
            </button>
            <button
              onClick={verifyPhoneOTP}
              disabled={loading || !phone || !otp}
              className="px-4 py-2 bg-green-500 text-white rounded disabled:opacity-50"
            >
              Verify Phone OTP
            </button>
          </div>
        </div>

        {message && (
          <div className="p-3 bg-gray-100 rounded">
            <p className="text-sm">{message}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default AuthTest;
